import React from "react";
import ReactDOM from "react-dom";
import "antd/dist/antd.css";
import "./index.css";
import { Table, Tag, Space } from "antd";

const { Column, ColumnGroup } = Table;

const data = [
  {
    key: "1",
    device_ip_addr: "192.168.1.100",
    mac_addr: "255.255.255.0",
    hostname: "PC-1001",
    device_type: ["nice", "developer"],
  },
  {
    key: "2",
    device_ip_addr: "192.168.1.100",
    mac_addr: "255.255.255.0",
    hostname: "PC-1001",
    device_type: ["nice", "developer"],
  },
  {
    key: "3",
    device_ip_addr: "192.168.1.100",
    mac_addr: "255.255.255.0",
    hostname: "PC-1001",
    device_type: ["nice", "developer"],
  },
];

function Help() {
  return (
    <div>
      <Table dataSource={data}>
        <Column title="IP Address" dataIndex="device_ip_addr" key="firstName" />
        <Column title="Mac Address" dataIndex="mac_addr" key="lastName" />
        <Column title="Hostname" dataIndex="hostname" key="age" />
        <Column
          title="Tags"
          dataIndex="device_type"
          key="tags"
          render={(tags) => (
            <>
              {tags.map((tag) => (
                <Tag color="blue" key={tag}>
                  {tag}
                </Tag>
              ))}
            </>
          )}
        />
        <Column
          title="Action"
          key="action"
          render={(text, record) => (
            <Space size="middle">
              <a>Edit Device</a>
              <a>Remove</a>
            </Space>
          )}
        />
      </Table>
    </div>
  );
}

export default Help;
